import React from 'react';
import {HashRouter as Router, Route} from 'react-router-dom';
import Signup from './Signup';


const Routes = (
  <Router>
    <div>
      // <Route path="/" component={ Signup } />
      <Route exact path="/signup" component={ Signup } />
    </div>
  </Router>
)

export default Routes;
